import React, { Component } from "react";

const MovieComponent = (props) => {
    document.getElementById('moviedetailsId').innerHTML = "";
    return (
        <div id="moviedetailsId">

            <p>{props.moviedetails}</p>
        </div>
    )
}
export default MovieComponent;
